import './Expenseitem.css';

const ExpenseDate  = (p) => {

 const month =props.thatDay.toLocaleString('en-US',{month:'long'});
 const year =props.thatDay.toLocaleString('en-US',{day:'2-digit'});
 const day =props.thatDay.getFullYear();

  return ( 
    <div className="Date">
    <div>{month}</div>
    <div>{year}</div>
    <div>{day}</div>
    </div>
   );
}
 
export default ExpenseDate;
